import React from 'react'
import Component from './Component'
import { Main, MainGrid, Subgrid } from './Counteranimation.element'

function Counteranimation() {
    return (
        <Main>
            <MainGrid>
                <Component state='Happy' ></Component>
            </MainGrid>
        </Main>
      
    )
}

export default Counteranimation
